import ItemListContainer from 'ItemListContainer';
import NavBar from 'components/Navbar';


const Layout = ({children}) => {
  return (
    <>
  <main>
  <NavBar />
  {children}
  </main>
  <footer>
    ejemplo del un footer
  </footer>
  </>
  )
}

const Home = () => {
  return (
    <Layout>
    <h1>Este el el home</h1>
    </Layout>
  )
}

const Products = () => {
  return (
    <Layout>
    <h1>Lista de productos</h1>
    </Layout>
  )
}


const Profile = () => {
  return (
    <Layout>
    <h1>perfil del usuario</h1>
    </Layout>
  )
}



// App => Layout

function App() {
  return (
    <>
<Home />
<Products />
<Profile />
</>
  );
}

export default App;
